import Link from 'next/link';

const linkStyle = {
    marginRight: 15
};

const Header = props => (
    <div>
        <Link href="/ditastore">
            <a style={linkStyle}>Ditastore</a>
        </Link>
        <Link href="/tentang">
            <a style={linkStyle}>Tentang</a>
        </Link>
    </div>
);

export default menu;
